// SongButton.stories.js

import React from 'react';
import MusicBox from "./MusicBox";

export default {
  title: 'Atoms/SongButton',
  component: SongButton,
};

const Template = (args) => <SongButton {...args} />;

export const Default = Template.bind({});
Default.args = {
  image: 'none',
  title: 'Song Title',
  artist: 'Artist Name',
  album: 'album',
  duration: '4:44',
};
